INSERT INTO `boxes` VALUES
(1, '<?php\r\nglobal $user;\r\nif ($user->uid > 0) {\r\n  $username = $user->name;\r\n  $output =  t(''Welkom'') . '', '' . $username .  ''   |   '' . l(''Logout'', ''logout'');\r\n  } else {\r\n $output = l(t(''Login''), ''user'') . ''  |  '' .  l(t(''Register''), ''user/register'');\r\n  }\r\nreturn ''<div style="color:#ffffff;">''.$output.''</div>'';\r\n?>\r\n\r\n\r\n\r\n\r\n\r\n\r\n?>', 'Login', 3),
(3, 'Cras id enim arcu. Mauris ac massa turpis, vel pulvinar odio. Pellentesque condimentum iaculis sodales. Pellentesque habitant morbi tristique senectus et netus et malesuada fames ac turpis egestas. Aliquam erat volutpat. Pellentesque vulputate nisl eu mauris facilisis fringilla? Maecenas lacinia odio posuere dolor tempus sed fermentum nisl volutpat. Nam nibh dui; lacinia vitae scelerisque sit amet, gravida in ante. Vivamus ut leo justo, at euismod quam. Cras egestas urna eget lacus tempus et dapibus felis pellentesque. Etiam interdum nisi eget quam ornare facilisis. Integer tristique, odio a tempus ultricies, sapien metus egestas felis, lacinia venenatis libero enim nec purus. Nam gravida imperdiet faucibus. Suspendisse et ipsum quis enim vehicula vehicula. Morbi purus eros, pellentesque a ultricies at, dignissim at dui. Nulla eget commodo felis. Curabitur urna felis, fringilla sed amet.', 'Lipsum2', 1),
(4, '<div class="item-list"><ul><li><a href="/workspace/<?php global $user; print $user->uid ?>">Alle video''s van <?php print $user->name; ?></a></li></ul></div>', 'Werkplaats', 3),
(5, '<div class="item-list">\r\n<ul>\r\n<li><a href="/mediamosa/unpub/tbr/1/<?php global $user; print $user->uid ?>">Te beoordelen video''s</a></li>\r\n<li><a href="/unpublished/hbr/1/<?php global $user; print $user->uid ?>">Ongepubliceerde beoordeelde video''s</a></li>\r\n<li><a href="/unpublished/pbr/1/<?php global $user; print $user->uid ?>">Gepubliceerde beoordeelde video''s</a></li>\r\n</ul>\r\n</div>', 'Beoordelingen', 3),
(6, '<div class="item-list">\r\n<ul>\r\n<li><a href="/onvall1">Onbeoordeelde, ongepubliceerde video''s</a></li>\r\n<li><a href="/revall1">Beoordeelde, ongepubliceerde video''s</a></li>\r\n</ul>\r\n</div>', 'Wachtrij', 2),
(7, 'Welkom op het videoportal van het project Leerlingen voor Leerlingen. <br/><br/>Op deze site worden alle video''s geplaatst die ontwikkeld zijn door de deelnemende scholen.', 'Welcome note block', 2);
