INSERT INTO `contact_save` VALUES
(1, 'contact_page_mail', 1, 'LvL', 'robin@mnds.org', 'testtest', 1, 'Algemeen', 'SdBeer@lentiz.nl,robin@pwy.nl', 'testtest', 'LvL heeft u een bericht gestuurd via het contactformulier http://lvoorl.mnds.org/contact.\n\ntesttest', 1310135418, NULL, NULL, NULL),
(2, 'contact_page_mail', 1, 'LvL', 'robin@mnds.org', 'serge, testje - zo werkt het min of meer', 1, 'Algemeen', 'SdBeer@lentiz.nl,robin@pwy.nl', 'testje 2 - suboptimaal, want moet inloggen in site (met link naar site) om mail te zien, maar werkt wel - is dit afdoende?', 'LvL heeft u een bericht gestuurd via het contactformulier http://lvoorl.mnds.org/contact.\n\ntestje 2 - suboptimaal, want moet inloggen in site (met link naar site) om mail te zien, maar werkt wel - is dit afdoende?', 1310136023, NULL, NULL, NULL),
(3, 'contact_page_mail', 1, 'LvL', 'robin@mnds.org', 'asdfasdfsfasdf ', 1, 'Algemeen', 'SdBeer@lentiz.nl,robin@pwy.nl', 'asdfasdfasd asdf asdf asdf asd fas', 'LvL (robin@mnds.org) sent a message using the contact form at http://lvoorl.mnds.org/contact.\n\nasdfasdfasd asdf asdf asdf asd fas', 1310136749, NULL, NULL, NULL),
(4, 'contact_page_mail', 1, 'LvL', 'robin@mnds.org', 'sdfgsdfgsd', 1, 'Algemeen', 'SdBeer@lentiz.nl,robin@pwy.nl', 'dfgbsdfgscf', 'LvL (robin@mnds.org) sent a message using the contact form at http://lvoorl.mnds.org/contact.\n\ndfgbsdfgscf', 1310137111, NULL, NULL, NULL),
(5, 'contact_page_mail', 0, 'Steven koelewijn', 'klw@alfrink.nl', 'Kan niet door Site bladeren', 1, 'Algemeen', 'SdBeer@lentiz.nl,robin@pwy.nl', 'Beste mensen,\r\nIk kan geen geuploade video''s vinden. De mogelijkheid door de video''s te bladeren werkt dus niet! Site blijft steken op drie video''s die recent zijn geupload.... maar dat klopt niet omdat wij zelf recenter video''s hebben geupload. Site werkt niet goed klopt dit?\r\nGrt Steven Koelewijn', 'Steven koelewijn (klw@alfrink.nl) sent a message using the contact form at http://www.lvoorl.nl/contact.\n\nBeste mensen,\r\nIk kan geen geuploade video''s vinden. De mogelijkheid door de video''s te bladeren werkt dus niet! Site blijft steken op drie video''s die recent zijn geupload.... maar dat klopt niet omdat wij zelf recenter video''s hebben geupload. Site werkt niet goed klopt dit?\r\nGrt Steven Koelewijn', 1319712425, NULL, NULL, NULL),
(6, 'contact_page_mail', 3, 'Pim Gijsbers', 'p.gijsbers@maerlantcollege.nl', 'uploaden filmpje', 1, 'Algemeen', 'SdBeer@lentiz.nl,robin@pwy.nl', 'Ik heb geprobeerd een filmpje te uploaden. Kunnen jullie mij zeggen of dit uiteindelijk gelukt is?\r\n\r\nVr.gr. \r\nPim Gijsbers\r\nMaerlant College VMBO', 'Pim Gijsbers (p.gijsbers@maerlantcollege.nl) sent a message using the contact form at http://www.lvoorl.nl/contact.\n\nIk heb geprobeerd een filmpje te uploaden. Kunnen jullie mij zeggen of dit uiteindelijk gelukt is?\r\n\r\nVr.gr. \r\nPim Gijsbers\r\nMaerlant College VMBO', 1320170745, NULL, NULL, NULL),
(7, 'contact_page_mail', 30, 'pvdwindt', 'p.vdwindt@degoudsewaarden.nl', 'ww', 1, 'Algemeen', 'SdBeer@lentiz.nl', 'Ik ben mijn wachtwoord kwijt! Dan krijg ik een nieuwe instructie en zou ik doorgestuurd worden naar http://www.lvoorl.nl/user/30/edit waar u uw wachtwoord kunt wijzigen.\r\nWaar kan ik hem dan wijzigen???? Ik vind niets.....', 'pvdwindt (p.vdwindt@degoudsewaarden.nl) sent a message using the contact form at http://www.lvoorl.nl/contact.\n\nIk ben mijn wachtwoord kwijt! Dan krijg ik een nieuwe instructie en zou ik doorgestuurd worden naar http://www.lvoorl.nl/user/30/edit waar u uw wachtwoord kunt wijzigen.\r\nWaar kan ik hem dan wijzigen???? Ik vind niets.....', 1321524802, NULL, NULL, NULL),
(8, 'contact_page_mail', 31, 'Kevin Jansen', 'kjansen02@lentiz.nl', 'filmpjes', 1, 'Algemeen', 'SdBeer@lentiz.nl', 'Hallo,\r\n\r\nWij hebben een aantal filmpjes geupload, waaronder ''Bombardement van Rotterdam'' deze staat al meer dan een maand op de site maar is tot op heden nog steeds niet ''gepubliceerd''.\r\nNu vraag ik mij af wat ik hier aan kan doen, daar ik mijn filmpjes graag gepubliceerd zie. \r\n\r\nMet vriendelijke groet,\r\nKevin Jansen\r\n', 'Kevin Jansen (kjansen02@lentiz.nl) sent a message using the contact form at http://www.lvoorl.nl/contact.\n\nHallo,\r\n\r\nWij hebben een aantal filmpjes geupload, waaronder ''Bombardement van Rotterdam'' deze staat al meer dan een maand op de site maar is tot op heden nog steeds niet ''gepubliceerd''.\r\nNu vraag ik mij af wat ik hier aan kan doen, daar ik mijn filmpjes graag gepubliceerd zie. \r\n\r\nMet vriendelijke groet,\r\nKevin Jansen\r\n', 1321528526, NULL, NULL, NULL);
