(2, 28, 1, 3, 'No action', 'Uploader Unpublished Example', 'Uw L voor L video bericht met de naam "Uploader Unpublished Example" is  <br />\ngemodereerd door onze redactie, maar is nog niet goedgekeurd.<br />\n<br />\nNote:<br />\n   Test<br />\nOm de redactie een antwoord te sturen, kan u  naar  <br />\nhttp://lvoorl.mnds.org/node/28/log/response/4ae3dcc478be51b0dd2a710a084a594a  <br />\ngaan.<br />\n<br />\nU kan uw http://lvoorl.mnds.org/content/uploader-unpublished-example na  <br />\ninloggen zelf zien en aanpassen, maar de video is nog niet zichtbaar voor  <br />\nandere gebruikers.<br />\n<br />\nRegards,<br />\nThe L voor L team', '\r\n<div id="node-28" class="node odd node-unpublished teaser node-type-mediamosa_videocontent">\r\n  <div class="inner">\r\n        <div class="clearfix">\r\n      \r\n            <h2 class="title"><a href="/content/uploader-unpublished-example" title="Uploader Unpublished Example">Uploader Unpublished Example</a></h2>\r\n      \r\n            <div class="meta">\r\n        <span class="submitted">Ingezonden door <a href="/users/uploader" title="Gebruikersprofiel weergeven.">uploader</a> op zo, 06/26/2011 - 15:45</span>\r\n      </div>\r\n          </div>\r\n    \r\n    \r\n    <div class="content clearfix">\r\n      <p>Lalala</p>\n<div class="field field-type-emvideo field-field-mediamosa-videofile">\n    <div class="field-items">\n            <div class="field-item odd">\n                    <div class="emvideo emvideo-video emvideo-mediamosa"><script type=''text/javascript'' src=''http://player.vpcore.snkn.nl/swfobject-licensed.js''></script>\r\n<div id=''mediaspace''>This div will be replaced</div>\r\n<script type=''text/javascript''>\r\nvar s1 = new SWFObject(''http://player.vpcore.snkn.nl/player-licensed.swf'',''ply'',''425'',''370'',''9'');\r\ns1.addParam(''allowfullscreen'',''true'');\r\ns1.addParam(''allowscriptaccess'',''always'');\r\ns1.addParam(''wmode'',''opaque'');\r\ns1.addParam(''flashvars'',''streamer=rtmp://wowstreaming.snkn.nl/vod&file=vpx/123/Z1gMXLSfWOLlkMhQcF15ORFj.mp4&skin=http://player.vpcore.snkn.nl/classic.zip&autostart=false'');\r\ns1.addVariable(''type'', ''mp4'');\r\ns1.write(''mediaspace'');\r\n</script></div>        </div>\n        </div>\n</div>\n<fieldset class="fieldgroup group-technical"><legend>Technical metadata</legend><div class="description">Technical metadata descriptive fields</div><div class="field field-type-mediamosa-metadata field-field-meta-file-duration">\n      <div class="field-label">Tijdsduur:&nbsp;</div>\n    <div class="field-items">\n            <div class="field-item odd">\n                    00:01:25.51        </div>\n        </div>\n</div>\n<div class="field field-type-mediamosa-metadata field-field-meta-filesize">\n      <div class="field-label">File size:&nbsp;</div>\n    <div class="field-items">\n            <div class="field-item odd">\n                    2404520        </div>\n        </div>\n</div>\n<div class="field field-type-mediamosa-metadata field-field-meta-mediafile-id">\n      <div class="field-label">Mediafile ID:&nbsp;</div>\n    <div class="field-items">\n            <div class="field-item odd">\n                    j1ROMSajMWXfNRONDQEaYOUY        </div>\n        </div>\n</div>\n<div class="field field-type-mediamosa-metadata field-field-meta-mime-type">\n      <div class="field-label">MIME type:&nbsp;</div>\n    <div class="field-items">\n            <div class="field-item odd">\n                    video/mp4        </div>\n        </div>\n</div>\n<div class="field field-type-mediamosa-metadata field-field-meta-container-type">\n      <div class="field-label">Container:&nbsp;</div>\n    <div class="field-items">\n            <div class="field-item odd">\n                    mov;mp4;m4a;3gp;3g2;mj2        </div>\n        </div>\n</div>\n<div class="field field-type-mediamosa-metadata field-field-meta-size">\n      <div class="field-label">Video size:&nbsp;</div>\n    <div class="field-items">\n            <div clas