('user_mail_password_reset_body', 's:434:"!username,\r\n\r\nEr is een verzoek ingediend bij !site om uw wachtwoord te resetten:\r\n\r\nU kunt nu inloggen bij !uri_brief door op de onderstaande link te klikken of deze in uw browser te kopiren:\r\n\r\n!login_url\r\n\r\nDit is een eenmalige login en kan dus maar nmaal worden gebruikt. Indien de login niet wordt gebruikt, vervalt deze na een dag.\r\n\r\nNa het inloggen wordt u doorgestuurd naar !edit_uri waar u uw wachtwoord kunt wijzigen.";'),
