('user_mail_status_activated_body', 's:448:"!username,\r\n\r\nUw account op !site is geactiveerd.\r\n\r\nU kunt nu inloggen door op de onderstaande link te klikken of deze in uw browser te kopiren:\r\n\r\n!login_url\r\n\r\nDit is een eenmalige login en kan dus maar nmaal worden gebruikt.\r\n\r\nNa het inloggen wordt u doorgestuurd naar !edit_uri waar u uw wachtwoord kunt wijzigen.\r\n\r\nNadat u uw wachtwoord heeft gewijzigd, kunt u in de toekomst inloggen op !login_uri met:\r\n\r\ngebruikersnaam: !username\r\n";'),
