('themekey_attributes', 'a:53:{s:16:"drupal:base_path";a:2:{s:11:"description";s:122:"Drupal: Base path - If Drupal is installed in a subdirectory the base path will be ''/[subdirectory]/'', otherwise just ''/''.";s:10:"page cache";i:1;}s:12:"drupal:get_q";a:3:{s:11:"description";s:66:"Drupal: $_GET[''q''] - Current value of drupal''s query parameter "q"";s:9:"validator";s:0:"";s:10:"page cache";i:1;}s:20:"drupal:is_front_page";a:3:{s:11:"description";s:85:"Drupal: Is front page - ''true'' if current page is front page, otherwise just ''false''.";s:9:"validator";s:33:"themekey_validator_string_boolean";s:10:"page cache";i:1;}s:11:"drupal:path";a:3:{s:11:"description";s:1387:"Drupal: Drupal path like "node/add/story" or path alias with support for wildcards.<br />\nQuery parameters are stripped off before the path gets examined. P.e. "node/add/story?destination=node" becomes "node/add/story" first. If you want to access query parameters have a look at the system:query_param property provided by <a href="http://drupal.org/project/themekey_properties">ThemeKey Properties</a>.<br />\nWildcard characters are "#" for numeric parts and "%" for all characters. To match conditions against a certain part, use an identifier with the wildcard. For example "comment/reply/#xyz" matches all paths with "comment/reply" and a numeric third argument. You can then specify conditions for every wildcard argument using the property "drupal:path:wildcard" and the identifier you choose ("xyz" in this example).<br />\nThese are the possible wildcard replacements for foo/bar/42/test.html:<pre>\nfoo/bar/42/test.html\nfoo/bar/42/%\nfoo/bar/42\nfoo/bar/%/test.html\nfoo/bar/%/%\nfoo/bar/%\nfoo/bar/#/test.html\nfoo/bar/#/%\nfoo/bar/#\nfoo/bar\nfoo/%/42/test.html\nfoo/%/42/%\nfoo/%/42\nfoo/%/%/test.html\nfoo/%/%/%\nfoo/%/%\nfoo/%/#/test.html\nfoo/%/#/%\nfoo/%/#\nfoo/%\nfoo\n%/bar/42/test.html\n%/bar/42/%\n%/bar/42\n%/bar/%/test.html\n%/bar/%/%\n%/bar/%\n%/bar/#/test.html\n%/bar/#/%\n%/bar/#\n%/bar\n%/%/42/test.html\n%/%/42/%\n%/%/42\n%/%/%/test.html\n%/%/%/%\n%/%/%\n%/%/#/test.html\n%/%/#/%\n%/%/#\n%/%\n%\n</pre>";s:9:"validator";s:30:"themekey_validator_drupal_path";s:10:"page cache";i:1;}s:20:"drupal:path:wildcard";a:3:{s:11:"description";s:72:"Wildcard of "drupal:path". See explanation of "drupal:path" for details.";s:9:"validator";s:27:"themekey_validator_wildcard";s:10:"page cache";i:1;}s:15:"locale:language";a:3:{s:11:"description";s:198:"Locale: Language - The code of the current site language, formatted like "en" or "de". See <a href="/admin/settings/language">admin/settings/language</a> to find the codes for your enabled languages";s:9:"validator";s:27:"themekey_validator_language";s:10:"page cache";i:1;}s:12:"node:changed";a:3:{s:11:"description";s:115:"Node: Changed date - The date when the node was last edited/updated, formatted as unix timestamp like "1248873565".";s:9:"validator";s:30:"themekey_validator_ctype_digit";s:10:"page cache";i:1;}s:17:"node:changed_date";a:3:{s:11:"description";s:113:"Node: Changed date - The date without the time when the node was last edited/updated, formatted like "2009-12-24"";s:9:"validator";s:23:"themekey_validator_date";s:10:"page cache";i:1;}s:22:"node:changed_date_time";a:3:{s:11:"description";s:124:"Node: Changed date - The date including the time when the node was last edited/updated, formatted like "2009-12-24 18:13:24"";s:9:"validator";s:28:"themekey_validator_date_time";s:10:"page cache";i:1;}s:12:"node:created";a:3:{s:11:"description";s:103:"Node: Created date - The date when the node was created, formatted as unix timestamp like "1248873565".";s:9:"validator";s:30:"themekey_validator_ctype_digit";s:10:"page cache";i:1;}s:17:"node:created_date";a:3:{s:11:"description";s:101:"Node: Created date - The date without the time when the node was created, formatted like "2009-12-24"";s:9:"validator";s:23:"themekey_validator_date";s:10:"page cache";i:1;}s:22:"node:created_date_time";a:3:{s:11:"description";s:112: